import React from "react";

const Pokemon = () => {
  const [items, setItems] = React.useState([]);
  React.useEffect(() => {
    fetch("https://api.tcgdex.net/v2/en/sets").then((res) => res.json())
    .then((json) => {
      setItems(json);
    });
}, []);
return (
  <div className="App">
    <h1> All Pokemon trading card game official play sets:</h1>
    {items.map((item) => (
      <ul key={item.id}>
        <li>
          Set's name: {item.name}
          <br /> Total cards annouced: {item.cardCount.total}
          <br /> Offical cards released: {item.cardCount.official}
        </li>
      </ul>
    ))}
  </div>
);
};


export default Pokemon;
